import React from 'react';


const NavBar = () => {
    return (
        <nav className="container navbar navbar-expand-sm navbar-dark px-sm-5">
            <ul>
                <li><Link to="">Home</Link></li>
                <li><Link to="">New Arrivals</Link></li>
                <li><Link to="">Home</Link></li>
            </ul>
        </nav>            
    );
}

export default NavBar;
